import React from 'react';
import Home from './Home';
import SignUp from './SignUp';
import Preferences from './Preferences';
import TimePreferences from './TimePreferences';

import {
    Route,
    Switch,
} from 'react-router-dom';

function Body () {
    return (
        <Switch>
            <Route exact path="/">
                <Home/>
            </Route>
            <Route path="/signUp">
                <SignUp/>
            </Route>
            <Route path="/preferences">
                <Preferences/>
            </Route>
            <Route path="/time">
                <TimePreferences/>
            </Route>
        </Switch>
    );
}

export default Body;
